import {Route} from 'react-router-dom';
import Welcome from './pages/welcome';
function App() {
  return (
    <div>
    <Route path='/welcome'>
      <Welcome></Welcome>
    </Route>
    <Route></Route>
    </div>
  );
}

export default App;
